import React from "react";
import { useState } from "react";
import { Modal, Button } from "react-bootstrap";
import "./Rake_Form.css";

function RakeForm() {
  const cellStyle1 = {
    border: "0.3px solid white",
    padding: "8px",
    background: "#0eacb3",
    color: "white",
    fontSize: "12px",
    fontWeight: "400",
    width: "150px",
  };
  const cellStyle2 = {
    border: "0.3px solid white",
    padding: "8px",
    background: "#75d0d4",
    color: "white",
    fontSize: "13px",
    fontWeight: "300",
    width: "400px",
  };
  const [show, setShow] = useState(false);
  const handleShow = () => setShow(true);
  const [AddMultipleDefficiencyinwagons,setAddMultipleDefficiencyinwagons ] = useState(false);
  const handle_AddMultipleDefficiencyinwagons = () =>setAddMultipleDefficiencyinwagons(true);
  const handle_AddMultipleDefficiencyinwagons_Close = () =>{
    setAddMultipleDefficiencyinwagons(false)
  }

  const handleClose = () => {
    setShow(false);
    setIndentType("text");
    setServingStationArrivalTime("text");
    setServingStationDepartureTime("text");
    setMarshallingofwagonsIntime("text");
    setMarshallingofwagonsOuttime("text");
    setRailwayPlacementTime("text");
    setUploadingStartTime("Text");
    setLoadingCompletionTime("Text");
    setRakeFormationCompletion("Text");
